def find_xcombat():
    """ Searches for the XCombat executable under the ACE Zero directory and
    returns the absolute path if found. """
    path = os.path.dirname(__file__)
    for root, dirs, files in os.walk(path):
        for filename in files:
            if ("xcombat" in filename.lower() and
                    filename.lower().endswith(".exe")):
                return os.path.join(root, filename)
    return None


def return_fitness_ace_zero(parameters):
    viper_params = parameters[0]
    cobra_params = parameters[1]

    args = parse_arguments(sys.argv[1:])
    score = (0, 0)
    # score = run_ace_zero(viper_params, cobra_params, **vars(args))

    i = 0
    while i < 5:
        score1 = run_ace_zero(viper_params, cobra_params, **vars(args))
        score = tuple(map(operator.add, score, score1))
        i += 1

    final = map(lambda x: x/5, score)

    return final

